import './App.css';
import { Route, BrowserRouter, Link } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
    <React.Fragment>
    <Link to="/">Navbar</Link>
    <Route path="/" exact component={Home} />
    </React.Fragment>
      </BrowserRouter>
  );
}

export default App;
